import RSVPform from './components/RsvpForm';
import React from 'react';

class RSVP extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="rsvp">
                <h2>RSVP</h2>
                <>
                    {this.props.response ?
                        <p>Thank you for responding. We will contact you soon</p> :
                        <RSVPform name={this.props.name} />}
                </>
            </div>
        );
    }

}

export default RSVP;
